import React from 'react';

import Header from '../Header/Header';
import Content from '../Content/Content';
import Footer from '../Footer/Footer';

const Layout = (props) => {
    return (
        <div className="wrapper">
            {console.log(props.location)}
            <Header />
            <Content props={props}/>
            <Footer />
        </div>
    )
}

export default Layout ;
